import React from 'react';
import { Article } from './articleRegDrop';
import { Workshop } from './workshopRegDrop';
import { ModalPrototype } from '../../modal'

//handleClose es una función que cierra el modal
//show es un boolean que especifica si se debe o no ver el modal
//registration es true si y sólo si se da un alta

export const ModalArt = ({ handleClose, show, registration }) => {//Se encargará de los forms para dar de alta/baja a los artículos
    return (
        <ModalPrototype show={show} handleClose={handleClose}
            children={<Article registration={registration} />} />//El modal debe mostrar el form especificado en Article
    );
}

export const ModalWork = ({ handleClose, show, registration }) => {//Se encargará de los forms para dar de alta/baja a los talleres
    return (
        <ModalPrototype show={show} handleClose={handleClose}
            children={<Workshop registration={registration} />} />//El modal debe mostrar el form especificado en Workshop
    );
}
